import React from 'react';
import Header from './header';
import Content from './content';
import Footer from './footer';

const SocialCard = () => {
	return (
		<div className=''>
			<Header
				icon = 'tower'
				userName = 'Bob Heyward'
				date = 'May 6 2019'
				title = 'This is a test'
				author = 'DP'/>

			<div className='br1 ba tr'>
				<Content 
					img = 'BabySteps'
					text = 'One step at a time.'
					link = 'Citadeholdings.co.il'/>
			</div>
				<Footer
				comments = '2'
				shares = '1'
				likes = '4'
				emailLink = 'dovid@citadelholdings.co.il'/>
		</div>
		)
};

export default SocialCard;
